import React from 'react'
import './styles/streamers.css'
import InfoLogin from './InfoLogin'
import LoadStreamers from '../components/LoadStreamers'

class Streamers extends InfoLogin {
    constructor(props){
        super(props)
        this.state = {
            pepe: [{
                "id" : 1,
                "nombre" : "Juan"
            },{
                "id": 2,
                "nombre" : "Facu"
            },{
                "id": 3,
                "nombre" : "Corcho"
             }]
        }
    }
render(){
    return (
            <div className="container">
                <div className="row">

                    <div className="col-12 d-flex justify-content-center">
                            <div className="border-bottom-purecss-example align-items-center">
                            <h2 className="streamers-title pt-2"> Streamers </h2>
                            </div>
                     </div>

                     <div className="col-12">
                               {this.state.pepe.map((streamers)=> {
                                   return(
                                <div>
                                <LoadStreamers infopepe={streamers.id} />
                                </div>
                                )
                               })}
                     </div>
                </div>
            </div>
    
    )
}
}
export default Streamers
